import Particles from 'react-particles-js';
import './components/background.css'


function App() {
    return (
        <>
            <Particles/>
                    <div
                style={{
                    position: "absolute",
                    top: 0,
                    left: 0,
                    width: "100%",
                    height: "100%"
                }}
            >
        <div className="App" style={{backgroundColor: "black"}}>
            {/*<ParallaxBackground />*/}
                <SettingsContextProvider>
                    <QuestionnaireContextProvider>
                        <QuestionsPage/>

                    </QuestionnaireContextProvider>
                </SettingsContextProvider>
        </div>
                        </div>
                        </>
    );
}

export default App;
